import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { NavigationContainer } from '@react-navigation/native';

import index from '../screens/index';
import aboutUs from '../screens/about_us';

import indoor_list from '../screens/lists/indoor_gyms_list';
import outdoors_list from '../screens/lists/outdoor_spots_list';
import events_list from '../screens/lists/events_list';
import ices_list from '../screens/lists/ice_spots_list';
import mountain_routes_list from '../screens/lists/mountain_routes_list';
import other_activities_list from '../screens/lists/other_activities_list';

const Stack = createNativeStackNavigator();

export const Navigation = () => {
    return (
        <NavigationContainer>
            <Stack.Navigator>
                <Stack.Screen name="index" component={index} options={{ title: 'Climbing In Geourgia' }}/>
                <Stack.Screen name="about_us" component={aboutUs} options={{ title: 'About Us' }}/>

                <Stack.Screen name="indoor_list" component={indoor_list} options={{ title: 'indoors List' }}/>
                <Stack.Screen name="indoorsList" component={outdoors_list} options={{ title: 'indoors List' }}/>
                <Stack.Screen name="indoorsList" component={events_list} options={{ title: 'indoors List' }}/>
                <Stack.Screen name="indoorsList" component={ices_list} options={{ title: 'indoors List' }}/>
                <Stack.Screen name="indoorsList" component={mountain_routes_list} options={{ title: 'indoors List' }}/>
                <Stack.Screen name="indoorsList" component={other_activities_list} options={{ title: 'indoors List' }}/>
            </Stack.Navigator>
        </NavigationContainer>
    );
}
